"/Lotus/Language/G1Quests/IndexDrawingCTitle" :"Neewa's Drawing",
"/Lotus/Language/G1Quests/IndexEventA" :"[PH] : Low Risk, Negligible Rewards",
"/Lotus/Language/G1Quests/IndexEventB" :"[PH] : Moderate Risk, Adequate Rewards",
"/Lotus/Language/G1Quests/IndexEventBonusRewardMessageBody" :"You don’t stop do you, Tenno. I like that. And just seeing you take all those credits from Nef, it warms my heart. Here, I have one last gift for you.Enjoy,Darvo",
"/Lotus/Language/G1Quests/IndexEventBonusRewardMessageTitle" :"THE INDEX: Bonus",
"/Lotus/Language/G1Quests/IndexEventC" :"[PH] : High Risk, Attractive Rewards",
"/Lotus/Language/G1Quests/IndexEventCommunityMessageTitle" :"THE INDEX: Nef’s “Investment Opportunity”",
"/Lotus/Language/G1Quests/IndexEventInterimMessageBody" :"Oh, Tenno, I tell you, this is getting good. We’re on a roll and I don’t want it to stop. Here, take this, consider it good luck charm from your old pal, Darvo.",
"/Lotus/Language/G1Quests/IndexEventInterimMessageTitle" :"THE INDEX: On a roll!",
"/Lotus/Language/G1Quests/IndexEventRewardMessageTitle" :"THE INDEX: Jackpot",
"/Lotus/Language/G1Quests/IndexQuestCureHerChoice" :"Cure her",
"/Lotus/Language/G1Quests/IndexQuestCureHerTitle" :"Neewa Has Been Cured",
"/Lotus/Language/G1Quests/IndexQuestDescription" :"Nef Anyo has stolen the children of the Mycona Colony and it is up to you to get them back. You must challenge Nef on The Index and beat him at his own game. But Tenno, beware, not all is as it seems.",
"/Lotus/Language/G1Quests/IndexQuestErgoInitiate" :"The Glast Gambit",
"/Lotus/Language/G1Quests/IndexQuestErgoRelayMeetingBody" :"Ergo Glast, Founder and President of the Perrin Sequence would like to meet with you to discuss an urgent matter that is of concern to the Tenno. Come to our Relay office at your earliest convenience.",
"/Lotus/Language/G1Quests/IndexQuestErgoRelayMeetingTitle" :"Urgent Meeting Request: President Ergo Glast",
"/Lotus/Language/G1Quests/IndexQuestHelpText" :"<MINI_ARROW> <QUEST> The War Within<MINI_ARROW> Talk to Ergo Glast in Perrin Sequence room in any Relay",
"/Lotus/Language/G1Quests/IndexQuestLerHerChooseChoice" :"Let her decide",
"/Lotus/Language/G1Quests/IndexQuestLetHerChooseTitle" :"Neewa Has Made Her Choice",
"/Lotus/Language/G1Quests/IndexQuestNeewaDrawing1Body" :"Tenno, here is the drawing my operative was able to smuggle out of Neewa’s cell. Just in case you need to be reminded of who you are helping.-Ergo Glast",
"/Lotus/Language/G1Quests/IndexQuestNeewaDrawing1Title" :"Neewa's Drawing",
"/Lotus/Language/G1Quests/IndexQuestNeewaDrawing2Title" :"Another dispatch from Neewa",
"/Lotus/Language/G1Quests/IndexQuestNeewaDrawing3Title" :"Evidence of the Triuna",
"/Lotus/Language/G1Quests/IndexQuestNeewaDrawing4Body" :"We also found this in the data vault. The good news is that Neewa’s still alive.",
"/Lotus/Language/G1Quests/IndexQuestNeewaDrawing4Title" :"More from Neewa",
"/Lotus/Language/G1Quests/IndexQuestPullQuote" :"“We must exercise caution, don’t come on too strong, or he will back off. We need to, as they say, ‘hustle’ him.”",
"/Lotus/Language/G1Quests/IndexQuestSendHerHomeChoice" :"Send her home",
"/Lotus/Language/G1Quests/IndexQuestSendHerHomeTitle" :"Neewa Is Home",
"/Lotus/Language/G1Quests/IndexQuestStage1" :"Help Secure Mycona Colony",
"/Lotus/Language/G1Quests/IndexQuestStage2345" :"Challenge Nef Anyo on The Index",
"/Lotus/Language/G1Quests/IndexQuestStage68" :"Win back Neewa",
"/Lotus/Language/G1Quests/IndexQuestStage7" :"Find the source of Nef’s cheats",
"/Lotus/Language/G1Quests/IndexTitle" :"THE GLAST GAMBIT",
"/Lotus/Language/G1Quests/IndexTutorialA" :"So Tenno, you think you have what it takes to be a broker on The Index? Allow me educate you.",
"/Lotus/Language/G1Quests/IndexTutorialB" :"When you kill a Broker, they will drop an Index Point. Scramble, it’s your job to pick it up before the other team does.",
"/Lotus/Language/G1Quests/IndexTutorialC" :"You may hold any number of index points, but know that they’re worthless until you’ve deposited them in the Bank. We call this Capitalization.",
"/Lotus/Language/G1Quests/IndexTutorialD" :"But if you die on the way to the bank and you’ll drop all your points, leaving them vulnerable to all.",
"/Lotus/Language/G1Quests/IndexTutorialE" :"You see, The Index is a game of risk and reward. Hold too many points and you risk rewarding the other team. Tenno, you best make peace with the Void, The Index is about to begin.",
"/Lotus/Language/G1Quests/InfestedCorpusHiveEventCompleteTitle" :"What Doesn't Kill Us...",
"/Lotus/Language/G1Quests/InfestedCorpusHiveEventName" :"Breeding Grounds",
"/Lotus/Language/G1Quests/InfestedCorpusHiveEventToolTip" :"Alad V is threatening the entire sector with his Infested Hives, take them out.",
"/Lotus/Language/G1Quests/InfestedEventName" :"Mutalist Incursions",
"/Lotus/Language/G1Quests/InfestedIncursionsLotusTitle" :"Mutalist Incursions",
"/Lotus/Language/G1Quests/InfestedIncursionsOpeningBody" :"Do take a moment to review this announcement, I suspect you will find it most exciting.",
"/Lotus/Language/G1Quests/InfestedIncursionsOpeningTitle" :"Welcome to Your New Empire",
"/Lotus/Language/G1Quests/InfestedIncurSurvFinishedTitle" :"Fight On",
"/Lotus/Language/G1Quests/InvasionEventClanTrophyBody_FC_CORPUS" :"Our two houses have worked well together. May this statue always serve as a reminder of the ties between |CLAN_NAME| and The Corpus.-Alad V",
"/Lotus/Language/G1Quests/InvasionEventClanTrophyBody_FC_GRINEER" :"I know the Tenno of |CLAN_NAME|, you seek glory, not riches. You live and die for Victory.Take this statue. It celebrates your glory. It honors your victory.-Sargas Ruk",
"/Lotus/Language/G1Quests/InvasionEventClanTrophySubject_FC_CORPUS" :"A Symbol of Partnership",
"/Lotus/Language/G1Quests/InvasionEventClanTrophySubject_FC_GRINEER" :"A Symbol of Our Glory",
