"/Lotus/Language/G1Quests/KelaEventInterim2MessageBody" :"Kela is growing nervous. She never expected you to get this far. Grineer everywhere can see that the Executioners are not invincible.You can win this. You can set the defectors free.",
"/Lotus/Language/G1Quests/KelaEventInterim2MessageTitle" :"You Have This",
"/Lotus/Language/G1Quests/KelaEventInterimMessageBody" :"The look on Kela’s face when you won was priceless. Your defense is working and the trial is moving to the next phase. Keep it up.",
"/Lotus/Language/G1Quests/KelaEventInterimMessageTitle" :"Don’t Stop Fighting",
"/Lotus/Language/G1Quests/KelaEventKelaDefianceBody" :"The Tenno have cheated!",
"/Lotus/Language/G1Quests/KelaEventKelaDefianceTitle" :"MISTRIAL!",
"/Lotus/Language/G1Quests/KelaEventRewardMessageBody" :"Your Cephalon has been given her location.",
"/Lotus/Language/G1Quests/KelaEventRewardMessageTitle" :"Take Out Kela",
"/Lotus/Language/G1Quests/KelaEventRewardsClanTrophyBody" :"Tenno,Together you have ended Kela's savage executions, and no matter which fate you decided for the defectors, know that balance has been restored for now. Let this trophy stand in tribute to your victory.- The Lotus",
