"/Lotus/Language/G1Quests/LotusCorpusArnEtinaPluto" :"The death of Arn Etina means the corpus mineral pipeline has been severed. Robotics production will be disrupted for weeks.",
"/Lotus/Language/G1Quests/LotusCorpusHyenaNeptune" :"Robotics with a pack mentality – the Corpus are beginning to raise all defenses. The Hyena model is their deadliest yet.",
"/Lotus/Language/G1Quests/LotusCorpusJackalVenus" :"Seeing The Jackal in action is grim – it’s clear the Corpus are capable of producing robotics beyond which we imagined.",
"/Lotus/Language/G1Quests/LotusCorpusRaptorEuropa" :"The Raptor is the most recent heavy weapon prototype developed by the Corpus. You must destroy it before they can begin full scale production.",
"/Lotus/Language/G1Quests/LotusCorpusSgtNefAnyoMars" :"The death of Sergeant Nef Anyo should weaken the Corpus Research and Development operations for some time.",
"/Lotus/Language/G1Quests/LotusFormorianEventDefend" :"Excellent, the corruption process has begun. You must defend this position to ensure the Grineer do not destroy this fuel cell before it spreads through the ship.",
"/Lotus/Language/G1Quests/LotusFormorianEventExtraction" :"Corruption process is complete. Good work Tenno. Get to extraction where I will record your contribution to the operation!",
"/Lotus/Language/G1Quests/LotusFormorianEventObjectiveLocated" :"There it is! You should be able to inject the corruptor you brought using the attached console.",
"/Lotus/Language/G1Quests/LotusFormorianEventPrerequisite" :"These Fomorians are massive, keep searching. You will need to locate a fuel cell and inject the corrupting agent. I hope you have a corruptor with you.",
"/Lotus/Language/G1Quests/LotusFormorianEventRestriction" :"Remember, if you are coordinating with other Tenno the Alpha/Beta mixtures are more potent, but a single Tenno cannot equip them at once.",
"/Lotus/Language/G1Quests/LotusGrineerCaptainVorMercury" :"The defeat of Grineer Captain Vor opens up other regions for the Tenno.",
"/Lotus/Language/G1Quests/LotusGrineerCounslarVayHekEarth" :"The death of Counciler Vay Hek will bring all Grineer deployments to a halt.",
"/Lotus/Language/G1Quests/LotusGrineerGeneralSargasRukSaturn" :"Eliminating a Grineer General will render the Saturn region helplessly unorganized.",
"/Lotus/Language/G1Quests/LotusGrineerSniperKela" :"Kela de Thaym's death will no doubt cause ripples of dissension amongst the inner circles of Grineer nobility.",
"/Lotus/Language/G1Quests/LotusGrineerTylRegorUranus" :"Tyl Regor was no ordinary Grineer – he was the leader in Cloning. The self-proclaimed father of future Grineer.",
"/Lotus/Language/G1Quests/LotusInfestedJ3GolemJupiter" :"That Golem was the most complex species of Infested we’ve encountered. Their ability to overtake multiple species is growing.",
"/Lotus/Language/G1Quests/MacheteBlueprintGiveawayMessage" :"Tenno,Our operatives have uncovered a hidden cache containing weapon data of Grineer origins. Use their secrets against them.-Lotus",
