"/Lotus/Language/G1Quests/PortalEventRewardOneBody" :"Tenno,Your first strikes against the Grineer are already forcing them to rally reinforcements. Fortunately, Void Keys are much harder to come by than Grineer clones. With effort we can destroy their entire stock of keys.The Lotus",
"/Lotus/Language/G1Quests/PortalEventRewardOneTitle" :"Operation Gate Crash: Keep Fighting",
"/Lotus/Language/G1Quests/PortalEventRewardThreeBody" :"Tenno,You have gone above and beyond. The Grineer are on the defense. Their supply of void keys is dwindling. To recognize your sacrifice I am giving you this weapon. Use it to defend the balance.The Lotus",
"/Lotus/Language/G1Quests/PortalEventRewardThreeTitle" :"Operation Gate Crash: Recognizing Your Sacrifice",
"/Lotus/Language/G1Quests/PortalEventRewardTwoBody" :"Tenno,I am impressed with your progress |PLAYER_NAME| but exposure to the void keys has left you vulnerable. Take these mods, I hope they will help you in your attack.The Lotus",
"/Lotus/Language/G1Quests/PortalEventRewardTwoTitle" :"Operation Gate Crash: A Boost",
"/Lotus/Language/G1Quests/ProjectFriendlyFireTacAlertBadgeRewardMsgBody" :"The Razorbacks have been destroyed. Perhaps next time, Nef won’t be quite so arrogant.-The Lotus",
