"/Lotus/Language/G1Quests/ProjectMutalistTacAlertRewardMsgTitle" :"Black Seed Scourge: Juggernaut Spotted",
"/Lotus/Language/G1Quests/ProjectMutalistTacAlertRewardOneBody" :"Those Black Seed Operatives were small change but they coughed up the bigger coins. Go to Jupiter and bring us their Commanders, and take this <CREDITS>|CREDIT_REWARD| as a down payment for services rendered.Frohd Bek",
"/Lotus/Language/G1Quests/ProjectMutalistTacAlertRewardOneTitle" :"Black Seed Scourge: Commanders Located",
"/Lotus/Language/G1Quests/ProjectMutalistTacAlertRewardTwoBody" :"And so we move up the chain of command, from Commanders to Lieutenants. These fanatics have fled to Eris, bring them to us, they will know where the Juggernaut spores are hidden.Frohd Bek",
"/Lotus/Language/G1Quests/ProjectMutalistTacAlertRewardTwoTitle" :"Black Seed Scourge: Fanatics near Eris",
"/Lotus/Language/G1Quests/ProjectMutalistTacAlertTitle" :"Black Seed Scourge",
"/Lotus/Language/G1Quests/ProjectNightwatchRewardMsgA" :"Tenno,We have recovered vital information from the messages you intercepted. Take this with my thanks. <CREDITS> |CREDIT_REWARD|- The Lotus",
"/Lotus/Language/G1Quests/ProjectNightwatchRewardMsgB" :"Tenno,You have quelled this new threat from the Grineer. Take this with my gratitude.- The Lotus",
"/Lotus/Language/G1Quests/ProjectNightwatchRewardMsgC" :"Well done Tenno,Your efforts have surely setback the machinations of the Grineer. Take this as a token of my thanks.- The Lotus",
"/Lotus/Language/G1Quests/ProjectNightwatchTacAlertCommunityMsgDesc" :"Tenno,The Nightwatch Corps. are back. A lone survivor from a massacre near Ceres has revealed that they have set up base there. We need to know what they’re up to. Travel to Ceres and intercept their communications. -The Lotus",
"/Lotus/Language/G1Quests/ProjectNightwatchTacAlertCommunityMsgTitle" :"Tactical Alert: Long Shadow",
"/Lotus/Language/G1Quests/ProjectNightwatchTacAlertMissionFourBody" :"Our last raid on the Nightwatch’s galleon revealed a vast storehouse of supplies. Proceed to the coordinates and weaken the Nightwatch by stealing as many of their supplies as possible.",
"/Lotus/Language/G1Quests/ProjectNightwatchTacAlertMissionFourTitle" :"Tactical Alert: Long Shadow - Mission 4 Success",
"/Lotus/Language/G1Quests/ProjectNightwatchTacAlertMissionOneBody" :"The Nightwatch Corps. are back. A lone survivor from a massacre near Ceres has revealed that they have set up base there. We need to know what they’re up to. Travel to Ceres and intercept their communications.",
"/Lotus/Language/G1Quests/ProjectNightwatchTacAlertMissionOneTitle" :"Tactical Alert: Long Shadow - Mission 1 Success",
"/Lotus/Language/G1Quests/ProjectNightwatchTacAlertMissionRewardBody" :"Well done, Tenno. You sent the Nightwatch Corps. a message they won't soon forget.The Lotus",
"/Lotus/Language/G1Quests/ProjectNightwatchTacAlertMissionThreeBody" :"A Nightwatch controlled Galleon has been spotted orbiting Mars. Provide cover while a lone Tenno operative raids the ship for intel and supplies.",
"/Lotus/Language/G1Quests/ProjectNightwatchTacAlertMissionThreeTitle" :"Tactical Alert: Long Shadow - Mission 3 Success",
"/Lotus/Language/G1Quests/ProjectNightwatchTacAlertMissionTwoBody" :"The information you intercepted from Nightwatch communications shows they have acquired a Warframe cryopod. Head to the target location and defend the cryopod until it can be safely extracted.",
"/Lotus/Language/G1Quests/ProjectNightwatchTacAlertMissionTwoTitle" :"Tactical Alert: Long Shadow - Mission 2 Success",
