"/Lotus/Language/G1Quests/ProjectSinisterBonusRewardFinalMessage" :"SHADOW DEBT: Now We’re Really Even",
"/Lotus/Language/G1Quests/ProjectSinisterBonusRewardFinalTitle" :"This was found on one of the Acolytes... consider your favor paid in full.-Alad V",
"/Lotus/Language/G1Quests/ProjectSinisterBonusRewardMessage" :"SHADOW DEBT: Now We’re Even",
"/Lotus/Language/G1Quests/ProjectSinisterBonusRewardTitle" :"I’ll admit it, you got me out of a sticky situation back there, so let’s just call it even, shall we.-Alad V",
"/Lotus/Language/G1Quests/ProjectSinisterBonusTitle" :"Shadow Debt: Endurance",
"/Lotus/Language/G1Quests/ProjectSinisterBRewardTitle" :"SHADOW DEBT: Keep Up the Hunt",
"/Lotus/Language/G1Quests/ProjectSinisterCommunityReq" :"Operation continues until all Acolytes defeated.",
"/Lotus/Language/G1Quests/ProjectSinisterCRewardMessage" :"Our contract is complete.",
"/Lotus/Language/G1Quests/ProjectSinisterCRewardTitle" :"SHADOW DEBT: Now We’re Even",
"/Lotus/Language/G1Quests/ProjectSinisterFinalMessage" :"It seems you have filed a fraudulent report regarding the death of all Acolytes...",
