"/Lotus/Language/G1Quests/ProjectSinisterTooltipBonus" :"Hold out against endless waves of Acolyte forces.",
"/Lotus/Language/G1Quests/ProjectSinisterTooltipC" :"Defend Alad V from Acolyte attack.",
"/Lotus/Language/G1Quests/ProjectSinisterTrophyRewardMessage" :"|CLAN_NAME|,Don’t think your efforts went unnoticed Tenno. Perhaps you lot could work for me someday?-Alad V",
"/Lotus/Language/G1Quests/ProjectSinisterTrophyRewardTitle" :"SHADOW DEBT: A Notable Effort",
"/Lotus/Language/G1Quests/ProjectUndermineTacAlertBadgeRewardMsgBody" :"You got all of them Nightwatch, right? Yeah, I know you did. Here’s that little something I promised. But just so you know, after this we’re square, so don’t go thinking I’m in your debt or nothing.Cya, Tin Suit.",
"/Lotus/Language/G1Quests/ProjectUndermineTacAlertBadgeRewardMsgTitle" :"Tactical Alert: Project Undermine - Complete",
"/Lotus/Language/G1Quests/ProjectUndermineTacAlertCommunityMsgTitle" :"Tactical Alert: Project Undermine",
"/Lotus/Language/G1Quests/ProjectUndermineTacAlertRewardHardMsgTitle" :"Tactical Alert: Project Undermine - Target Rescued",
"/Lotus/Language/G1Quests/ProjectUndermineTacAlertRewardMsgTitle" :"Tactical Alert: Project Undermine - Situation Update",
"/Lotus/Language/G1Quests/ProjectUndermineTacAlertTitle" :"Project Undermine",
"/Lotus/Language/G1Quests/ProperctorIntroTitle" :"Silencing Vay Hek",
"/Lotus/Language/G1Quests/PS4_Exclusive_Sigil" :"A New Year ",
"/Lotus/Language/G1Quests/PSIVGiftMessage" :"|PLAYER_NAME|, You have fought long and hard for our cause. Take this gift as a token of my appreciation. The Lotus ",
"/Lotus/Language/G1Quests/PSIVGiftTitle" :"A Gift From the Lotus",
"/Lotus/Language/G1Quests/Q10-1" :"Strained",
"/Lotus/Language/G1Quests/Q10E1End" :"Good work. Our informant can now continue his research. We have adapted some of his work on Grineer technology for you to use.",
"/Lotus/Language/G1Quests/Q10E1Intro" :"The canisters containing the DNA are scattered throughout the ship. Security is high... stay alert, and eliminate all those in your way.",
"/Lotus/Language/G1Quests/Q1-1" :"In Bad Taste",
"/Lotus/Language/G1Quests/Q11-1" :"The Jackal",
"/Lotus/Language/G1Quests/Q11E2" :"There is one last item to take care of. This Substrata ship houses the original prototype of ‘The Jackal’. Isolate the quad-robot’s position and take it down. In addition to sabotaging their work, this will be good test of your skill.",
"/Lotus/Language/G1Quests/Q11E2End" :"You have bought us much needed time. It will take them awhile to rebuild from this hit. Unfortunately, Substrata produced a number of units that are in active duty. This will not be the last time you encounter “The Jackal.",
"/Lotus/Language/G1Quests/Q1E4End" :"We mourn the loss of our people. Thanks to you they did not die in vain. We now know that Technocyte has detrimental effects on Grineer physiology.",
"/Lotus/Language/G1Quests/Q2-1" :"Ending Credits",
"/Lotus/Language/G1Quests/Q2E2End" :"Well done. With no one to champion the proposed redesign, we have effectively secured our reserves. We will continue to keep a close eye on this.",
"/Lotus/Language/G1Quests/Q3-1" :"A Pestilence Walketh",
"/Lotus/Language/G1Quests/Q3E2End" :"Unfortunately Hek is of no use to us. He is babbling incoherently about an “unfathomably horrible creature” that appeared and laid waste to his entire crew. It is clear he saw something very disturbing. Let us hope he recovers his senses.",
"/Lotus/Language/G1Quests/Q4-1" :"Into The Void",
"/Lotus/Language/G1Quests/Q5-1" :"In Fest Interests",
"/Lotus/Language/G1Quests/Q5E3End" :"Good work. You have eliminated the threat of a potentially devastating biological weapon.",
"/Lotus/Language/G1Quests/Q6-1" :"Will Power",
"/Lotus/Language/G1Quests/Q6E1End" :"With Skelk gone, we can only hope that he did not pass along his knowledge of Orokin technology.",
"/Lotus/Language/G1Quests/Q7-1" :"No Clone Of Their Own",
"/Lotus/Language/G1Quests/Q7E1Intro" :"There looks to be several locations on this facility containing cloning tech. Expect heavy resistance from the Grineer.",
"/Lotus/Language/G1Quests/Q7E2" :"Further intel suggests a disgruntled ex-Corpus scientific advisor named “Ayeri” has been providing the Grineer with classified cloning technology in exchange for Rubedo. We cannot allow this to continue.Get aboard Ayeri’s vessel and eliminate him.",
"/Lotus/Language/G1Quests/Q7E2End" :"With Ayeri gone, we have put a dent in Grineer plans to control their very own destiny.",
"/Lotus/Language/G1Quests/Q8-1" :"School's Out",
"/Lotus/Language/G1Quests/Q8E1End" :"Great work. School’s out... for now.",
"/Lotus/Language/G1Quests/Q8E1Intro" :"Beld has had countless threats against his life. As a result, he now travels with a large security team comprised of robotic proxies. Tread carefully.",
"/Lotus/Language/G1Quests/Q9-1" :"Children Are Our Future",
"/Lotus/Language/G1Quests/Q9E1End" :"Great work. With Izar gone, the program has dismantled. Our children will no longer suffer for the Grineer cause.",
"/Lotus/Language/G1Quests/QuestAnswerLater" :"Not yet",
"/Lotus/Language/G1Quests/QuestAnswerYes" :"Yes",
"/Lotus/Language/G1Quests/QuestMessage" :"For completing this quest, you have been awarded <CREDITS> |CREDIT_REWARD|",
"/Lotus/Language/G1Quests/QuestPromptIndex" :"Will you help Neewa’s people?",
"/Lotus/Language/G1Quests/QuestTitle" :"|QUEST_NAME| Completed",
"/Lotus/Language/G1Quests/RaidRewardInboxMessageSubject" :"Bravery in the Pursuit of Justice",
"/Lotus/Language/G1Quests/RazorbackArmadaAnnounceTitle" :"All Hands: Incoming Razorback Armada",
"/Lotus/Language/G1Quests/RazorbackArmadaDestroyedBody" :"Tenno,Nef Anyo's armada has been repelled, our relay is safe from the threat of attack. This surely won't be the last we hear of his Razorbacks, however. Stay vigilant for their return.-The Lotus",
"/Lotus/Language/G1Quests/RazorbackArmadaRewardBody" :"Tenno,You have proven your valor in battle today, but the machines are countless and do not rest. Take this reward and use it to continue the fight!The Lotus<CREDITS> |CREDIT_REWARD|",
"/Lotus/Language/G1Quests/RemindDailySimarisTask" :"<SIMARIS> Remind me of my target.",
