"/Lotus/Language/G1Quests/RescueEventInGameTitle" :"Specters of Liberty",
"/Lotus/Language/G1Quests/RescueEventInGameTooltip" :"Earn enough points and the Red Veil will commemorate your efforts with an emblem and even a special Syandana.Prison Locations:Mars - VallisEris - BrugiaNeptune – NereidSaturn - NumaUranus - MabCeres - Cinxia",
"/Lotus/Language/G1Quests/RescueEventRewardOneMessageTitle" :"You Are Making the Difference",
"/Lotus/Language/G1Quests/RescueEventRewardTwoMessageTitle" :"A Symbol of Our Gratitude",
