"/Lotus/Language/G1Quests/RoboticTauntA" :"Trivial threat detected.",
"/Lotus/Language/G1Quests/RoboticTauntB" :"Threat level upgraded. Classification: Pathetic.",
"/Lotus/Language/G1Quests/RoboticTauntC" :"Prototype engagement test: Ready. Tenno destruction analytics: Recording.",
"/Lotus/Language/G1Quests/SargasRuk_InvasionRewardBody_Tier2" :"You did not have to fight like you did. You chose to support us. You chose to serve us. Take this weapon, it will make you strong like us.-Sargas Ruk",
"/Lotus/Language/G1Quests/SargasRuk_InvasionRewardBody_Tier3" :"The way you fight, we cannot grow this in a test tube. You are a true warrior. I need more warriors like you. Continue to fight for me, there is more where this came from.-Sargas Ruk",
"/Lotus/Language/G1Quests/SargasRuk_InvasionRewardSubject_Tier1" :"Our Victory at Gradivus",
"/Lotus/Language/G1Quests/SargasRuk_InvasionRewardSubject_Tier2" :"A Token",
"/Lotus/Language/G1Quests/SargasRuk_InvasionRewardSubject_Tier3" :"Above and Beyond",
"/Lotus/Language/G1Quests/SealabsEvent_Badge_Body" :"Tenno,You have made a tough choice and followed through with decisive action. Wear this emblem to memorialize this battle.-The Lotus",
"/Lotus/Language/G1Quests/SealabsEvent_Badge_Title" :"Tubemen of Regor: Emblem",
