"/Lotus/Language/G1Quests/SentientQuestObjective_StopTylDesc" :"Keep Tyl Regor from entering the tomb.",
"/Lotus/Language/G1Quests/SentientQuestPullQuote" :"The Lotus blossom has snapped shut, her true nature revealed. Now we shall see if codependence can be broken. Let us begin to unravel her long-hidden truth.\" -Teshin",
