"/Lotus/Language/G1Quests/SkateTacAlertCommunityMsgTitle" :"Tactical Alert: Shifting Sands",
"/Lotus/Language/G1Quests/SkateTacAlertReward2MsgDesc" :"Your efforts are commendable, but we can still use your help. Take this to assist you on your next mission.",
"/Lotus/Language/G1Quests/SkateTacAlertReward2MsgTitle" :"A Good Start",
"/Lotus/Language/G1Quests/SkateTacAlertRewardMsgDesc" :"Well done, Tenno. You have kept this vital resource out of the hands of the enemy. With most of our resources funneled into Project Archwing, I cannot offer you much for your service. Hopefully this will help in some way.- Lotus",
"/Lotus/Language/G1Quests/SkateTacAlertRewardMsgTitle" :"A Successful Mission",
