"/Lotus/Language/G1Quests/SpyQuestConclusion" :"The disappearance of the Arcane Machine has created a new mystery in the Origin System. Meanwhile, the Grineer have stopped hunting for Maroo and she has decided to go her own way.",
"/Lotus/Language/G1Quests/SpyQuestDescription" :"Once the severity of the Grineer capture order was made clear to her, Maroo was more than willing to accept our offer of protective custody. In exchange she will aid us in locating the Arcane Codices.",
