"/Lotus/Language/G1Quests/TacAlert_Overtake_Rewards_Body" :"Mission accomplished Tenno. We have the rover and thanks to your bravery in battle, the rover’s precious cargo is undamaged. In return for your effort I have sent you a small share of the spoils.-The Lotus",
