"/Lotus/Language/G1Quests/TennoBaumIntroInboxTitle" :"TENNOBAUM: Leading by Example",
"/Lotus/Language/G1Quests/TennobaumTier1InboxBody" :"|PLAYER_NAME|, I am elated with the Tenno’s willingness to give. In recognition of that generosity, please take this gift. - The Lotus",
"/Lotus/Language/G1Quests/TennoBaumTier1InboxTitle" :"TENNOBAUM: A Thank You",
"/Lotus/Language/G1Quests/TennobaumTier2InboxBody" :"|PLAYER_NAME|, Whispers of Tenno generosity have begun to echo through the Solar System. Others are rushing to thank you. They offer you this gift.- The Lotus",
"/Lotus/Language/G1Quests/TennoBaumTier2InboxTitle" :"TENNOBAUM: Honoring Generosity",
"/Lotus/Language/G1Quests/TennobaumTier3InboxBody" :"|PLAYER_NAME|, You’re an inspiration to those who suffered under the Grineer heel. Your actions have helped the System’s children in ways you could not imagine—here is another token of appreciation.- The Lotus",
"/Lotus/Language/G1Quests/TennoBaumTier3InboxTitle" :"TENNOBAUM: Renewed Hope",
"/Lotus/Language/G1Quests/TennobaumTier4InboxBody" :"|PLAYER_NAME|, If only you could hear the praises they are singing for you. The Tenno have brought such joy to the System’s children and their families. They offer you this in thanks.- The Lotus",
"/Lotus/Language/G1Quests/TennoBaumTier4InboxTitle" :"TENNOBAUM: Restoring Joy",
"/Lotus/Language/G1Quests/TennoBaumTier5InboxTitle" :"TENNOBAUM: A Thousand Thank Yous",
"/Lotus/Language/G1Quests/TennoRecognitionInboxTitle" :"Tenno Recognition",
"/Lotus/Language/G1Quests/TethrasDoomClanRewardMessage" :"Tenno of |CLAN_NAME|,The exceptional efforts of |CLAN_NAME| in thwarting Councilor Vay Hek have not gone unnoticed. Take this trophy and display it with pride, you earned it.Lotus",
