"/Lotus/Language/G1Quests/ThousandCutsRewardAMessage" :"You have only begun to scrape the rust from your sword. Keep practicing.",
"/Lotus/Language/G1Quests/ThousandCutsRewardATitle" :"ONE THOUSAND CUTS: A good start",
"/Lotus/Language/G1Quests/ThousandCutsRewardBMessage" :"A sharp blade that misses, hasn’t cut a thing.Stay focused.",
"/Lotus/Language/G1Quests/ThousandCutsRewardBTitle" :"ONE THOUSAND CUTS: Watch your enemy",
