"/Lotus/Language/G1Taunts/Razorback_Taunt1" :"|PLAYER_NAME| Detected: May the Void take mercy upon you",
"/Lotus/Language/G1Taunts/Razorback_Taunt2" :"Analysis Complete: |PLAYER_NAME| = UNBELIEVER",
"/Lotus/Language/G1Taunts/Razorback_Taunt3" :"|PLAYER_NAME| Victory Probability: UNFATHOMABLE ",
"/Lotus/Language/G1Taunts/Razorback_Taunt4" :"Configuring Tactics: PRAISE THE VOID",
"/Lotus/Language/G1Taunts/Regor_Taunt1" :"You shall suffer as we have, |PLAYER_NAME|.",
"/Lotus/Language/G1Taunts/Regor_Taunt2" :"Your little dress-up party ends here, |CLAN_NAME|",
"/Lotus/Language/G1Taunts/Regor_Taunt3" :"We should accessorize your suit with some holes... bullet holes.",
"/Lotus/Language/G1Taunts/Regor_Taunt4" :"You realize we haven't celebrated Halloween in about a millenia, right?",
"/Lotus/Language/G1Taunts/Regor_Taunt5" :"You have violated the dress code of this vessel. Failure to comply is punishable by death.",
"/Lotus/Language/G1Taunts/Regor_Taunt6" :"Take the 'Warfra' out of Warframe and what are you left with? You got it, 'me'!",
"/Lotus/Language/G1Taunts/Regor_Taunt7" :"I will reduce |CLAN_NAME| to ashes!",
"/Lotus/Language/G1Taunts/Regor_Taunt8" :"Grineer dominance is inevitable.",
"/Lotus/Language/G1Taunts/Ruk_Taunt1" :"Grineer perfection is inevitable!",
"/Lotus/Language/G1Taunts/Ruk_Taunt2" :"Grineer dominance will prevail!",
"/Lotus/Language/G1Taunts/Ruk_Taunt3" :"You are in the presence of Grineer perfection!",
"/Lotus/Language/G1Taunts/Ruk_Taunt4" :"Flesh is the flaw!",
"/Lotus/Language/G1Taunts/Ruk_Taunt5" :"Grineer immortality begins with the shedding of flesh.",
"/Lotus/Language/G1Taunts/Ruk_Taunt6" :"|PLAYER_WARFRAME|? Your pretentious suits are no match for my power!",
"/Lotus/Language/G1Taunts/Ruk_Taunt7" :"You are a walking tomb, |PLAYER_NAME|.",
"/Lotus/Language/G1Taunts/Ruk_Taunt8" :"Grineer dominance will prevail!",
"/Lotus/Language/G1Taunts/SargasRuk_TauntIneffectiveAbility" :"Your puny Tenno power is useless against me!",
"/Lotus/Language/G1Taunts/SargasRuk_TauntIneffectiveAbility02" :"Your puny Tenno power is useless against me!",
"/Lotus/Language/G1Taunts/SargasRuk_TauntIneffectiveAbility03" :"Your puny Tenno power is useless against me!",
"/Lotus/Language/G1Taunts/Stalker_TauntDeath" :"I... have failed... this one will remain... unpunished...",
"/Lotus/Language/G1Taunts/Stalker_TauntDeathA" :"No!? This is not... possible.",
"/Lotus/Language/G1Taunts/Stalker_TauntDeathB" :"What have you... done?",
"/Lotus/Language/G1Taunts/Stalker_TauntEscape" :"You may have survived for now, |LOCAL_PLAYER_NAME|, but your time WILL come!",
"/Lotus/Language/G1Taunts/Stalker_TauntEscapeB" :"You are stronger than I realized, |LOCAL_PLAYER_NAME|. No matter, this is only a temporary setback.",
"/Lotus/Language/G1Taunts/Stalker_TauntEscapeC" :"|LOCAL_PLAYER_NAME| you are a more worthy opponent than I expected. You punishment will have to wait.",
"/Lotus/Language/G1Taunts/Stalker_TauntIneffectiveAbility" :"Your TENNO powers are useless!",
"/Lotus/Language/G1Taunts/Stalker_TauntIntro1" :"|LOCAL_PLAYER_NAME|, you can't run from your past.",
"/Lotus/Language/G1Taunts/Stalker_TauntIntro1a" :"I know your every move |LOCAL_PLAYER_NAME|.",
"/Lotus/Language/G1Taunts/Stalker_TauntIntro1b" :"|LOCAL_PLAYER_NAME| there is no place to hide.",
"/Lotus/Language/G1Taunts/Stalker_TauntIntro2" :"The murder of |BOSS_TAG| will not go unpunished.",
"/Lotus/Language/G1Taunts/Stalker_TauntIntro2a" :"The blood of |BOSS_TAG| is on your hands. Did you really think there would be no repercussions?",
"/Lotus/Language/G1Taunts/Stalker_TauntIntro2b" :"There is no salvation for your crime against |BOSS_TAG|.",
"/Lotus/Language/G1Taunts/Stalker_TauntIntro3" :"Your sentence is death!",
"/Lotus/Language/G1Taunts/Stalker_TauntIntro3a" :"You shall not leave this place!",
"/Lotus/Language/G1Taunts/Stalker_TauntIntro3b" :"I am your reckoning!",
"/Lotus/Language/G1Taunts/Stalker_TauntTargetEliminated" :"It is done. |LOCAL_PLAYER_NAME| is no more.",
"/Lotus/Language/G1Taunts/Stalker_TauntTargetEliminatedA" :"Justice is served. |LOCAL_PLAYER_NAME| has been executed.",
"/Lotus/Language/G1Taunts/Stalker_TauntTargetEliminatedB" :"|LOCAL_PLAYER_NAME| shall not trouble us again.",
"/Lotus/Language/G1Taunts/SupportedTauntStrings" :"|PLAYER_NAME| |PLAYER_WEAPON| |PLAYER_WEAPON_RANK| |PLAYER_WEAPON_MODCOUNT| |PLAYER_WARFRAME| |CLAN_NAME| |PLAYER_NAMEB| |ENEMY_NAME| |ENEMY_WEAPON|",
"/Lotus/Language/G1Taunts/Vor_Taunt1" :"You hide behind that |PLAYER_WARFRAME| Warframe. Face me like a true warrior!",
"/Lotus/Language/G1Taunts/Vor_Taunt10" :"I am waiting... You are no match for me!",
"/Lotus/Language/G1Taunts/Vor_Taunt11" :"Let’s play hide and seek!",
"/Lotus/Language/G1Taunts/Vor_Taunt12" :"Your |PLAYER_WARFRAME| Warframe makes you slow and clumsy.",
