"/Lotus/Language/GameTips/TrinityDesc" :"Trinity is great for players who prefer a supportive role.Warframes with healing technology are rare, making Trinity a great equalizer when the odds are stacked against a group of Tenno.",
"/Lotus/Language/GameTips/Upgrades_AurasAddCapacity" :"Aura mods add to your total mod capacity.",
"/Lotus/Language/GameTips/Upgrades_BlastCombination" :"Combine Heat <DT_FIRE> and Cold <DT_FREEZE> to create Blast <DT_EXPLOSION> damage.Very effective against machinery.",
"/Lotus/Language/GameTips/Upgrades_CapacityMath" :"Capacity is the larger of a Weapon's Rank and your Mastery Rank, and is doubled if an Orokin Reactor or Catalyst is installed.",
"/Lotus/Language/GameTips/Upgrades_ColdDamage" :"Cold <DT_FREEZE> damage can slow down enemies and deal damage.",
"/Lotus/Language/GameTips/Upgrades_CorrosiveCombination" :"Combine Electricity <DT_ELECTRICITY> and Toxin <DT_POISON> to create Corrosive <DT_CORROSIVE> damage.Very effective against ferrite armor.",
"/Lotus/Language/GameTips/Upgrades_DifferentDamageDifferentEnemies" :"Enemies are resistant and vulnerable to various elements. Use the Codex scanner to learn about them.",
"/Lotus/Language/GameTips/Upgrades_Electricity" :"Electricity <DT_ELECTRICITY> damage is capable of stunning and damaging enemies.",
"/Lotus/Language/GameTips/Upgrades_ElementalDamageCombinations" :"Combine primary elemental damage types to create secondary ones.",
"/Lotus/Language/GameTips/Upgrades_FireDamage" :"Heat <DT_FIRE> damage will burn and scorch foes.",
"/Lotus/Language/GameTips/Upgrades_GasCombination" :"Combine Heat <DT_FIRE> and Toxin <DT_POISON> to create Gas <DT_GAS> damage.Very effective against infested.",
"/Lotus/Language/GameTips/Upgrades_MagneticCombination" :"Combine Cold <DT_FREEZE> and Electricity <DT_ELECTRICITY> to create Magnetic <DT_MAGNETIC> damage.Very effective against shields.",
