"/Lotus/Language/GameTips/Upgrades_OrderOfPrecepts" :"Install Companion precepts in the order you want them to be followed, starting from upper-left.",
"/Lotus/Language/GameTips/Upgrades_oxinDamage" :"Toxin <DT_POISON> damage is effective at damaging an enemy's health.",
"/Lotus/Language/GameTips/Upgrades_RadiationCombination" :"Combine Heat <DT_FIRE> and Electricity <DT_ELECTRICITY> to create Radiation <DT_RADIATION> damage.Very effective against alloy armor.",
"/Lotus/Language/GameTips/Upgrades_Stance" :"Stance mods unlock the ability to perform advanced combos.",
