"/Lotus/Language/Oddities/TwoSisters_Line_1" :"A story once lost",
"/Lotus/Language/Oddities/TwoSisters_Line_10" :"They judged them amiss",
"/Lotus/Language/Oddities/TwoSisters_Line_11" :"For they never witnessed",
"/Lotus/Language/Oddities/TwoSisters_Line_12" :"Two self-same as these",
"/Lotus/Language/Oddities/TwoSisters_Line_13" :"A mirrored reflection",
"/Lotus/Language/Oddities/TwoSisters_Line_14" :"Had come into life",
"/Lotus/Language/Oddities/TwoSisters_Line_15" :"By will of their father",
"/Lotus/Language/Oddities/TwoSisters_Line_16" :"Kept safe from the knife",
"/Lotus/Language/Oddities/TwoSisters_Line_17" :"Their sameness was shunned",
"/Lotus/Language/Oddities/TwoSisters_Line_18" :"As slave-like and soiled",
"/Lotus/Language/Oddities/TwoSisters_Line_19" :"They tended their strays",
"/Lotus/Language/Oddities/TwoSisters_Line_2" :"Recovered by fate",
"/Lotus/Language/Oddities/TwoSisters_Line_20" :"Rejected by all",
"/Lotus/Language/Oddities/TwoSisters_Line_21" :"As both girls matured",
"/Lotus/Language/Oddities/TwoSisters_Line_22" :"Their bond grew in depth",
"/Lotus/Language/Oddities/TwoSisters_Line_23" :"They had the same poise",
"/Lotus/Language/Oddities/TwoSisters_Line_24" :"Same senses, same strength",
"/Lotus/Language/Oddities/TwoSisters_Line_25" :"The uprising came",
"/Lotus/Language/Oddities/TwoSisters_Line_26" :"And spread like a weed",
"/Lotus/Language/Oddities/TwoSisters_Line_27" :"An army of copy-men",
"/Lotus/Language/Oddities/TwoSisters_Line_28" :"Ferocious and free",
"/Lotus/Language/Oddities/TwoSisters_Line_29" :"And much like the sea",
"/Lotus/Language/Oddities/TwoSisters_Line_3" :"The tale of two sisters",
"/Lotus/Language/Oddities/TwoSisters_Line_30" :"They came just like waves",
"/Lotus/Language/Oddities/TwoSisters_Line_31" :"For years they fought on",
"/Lotus/Language/Oddities/TwoSisters_Line_32" :"For years we remained",
"/Lotus/Language/Oddities/TwoSisters_Line_33" :"Like chisel to stone",
"/Lotus/Language/Oddities/TwoSisters_Line_34" :"War molded the twins",
"/Lotus/Language/Oddities/TwoSisters_Line_35" :"Who ravaged the hordes",
"/Lotus/Language/Oddities/TwoSisters_Line_36" :"Became legend to them",
"/Lotus/Language/Oddities/TwoSisters_Line_37" :"They had a deep strength",
"/Lotus/Language/Oddities/TwoSisters_Line_38" :"That came from each other",
"/Lotus/Language/Oddities/TwoSisters_Line_39" :"Unlike all these copies",
"/Lotus/Language/Oddities/TwoSisters_Line_4" :"Who bore the same face",
"/Lotus/Language/Oddities/TwoSisters_Line_40" :"Identical, but not brothers",
"/Lotus/Language/Oddities/TwoSisters_Line_41" :"The copies could see it",
"/Lotus/Language/Oddities/TwoSisters_Line_42" :"They yearned for it too",
"/Lotus/Language/Oddities/TwoSisters_Line_43" :"If the twins could do it",
"/Lotus/Language/Oddities/TwoSisters_Line_44" :"Perhaps they could too",
"/Lotus/Language/Oddities/TwoSisters_Line_45" :"The twins had attained",
"/Lotus/Language/Oddities/TwoSisters_Line_46" :"Something more than a whole",
"/Lotus/Language/Oddities/TwoSisters_Line_47" :"A true understanding",
"/Lotus/Language/Oddities/TwoSisters_Line_48" :"Of each other soul",
"/Lotus/Language/Oddities/TwoSisters_Line_49" :"The copies became believers",
"/Lotus/Language/Oddities/TwoSisters_Line_5" :"Born one quiet morning",
"/Lotus/Language/Oddities/TwoSisters_Line_50" :"One by one bowed to the twins",
"/Lotus/Language/Oddities/TwoSisters_Line_51" :"And led forth by their new masters",
"/Lotus/Language/Oddities/TwoSisters_Line_52" :"They ravaged the colonies",
"/Lotus/Language/Oddities/TwoSisters_Line_53" :"Now a power to follow",
"/Lotus/Language/Oddities/TwoSisters_Line_54" :"Not a force to be fought",
"/Lotus/Language/Oddities/TwoSisters_Line_55" :"From the ashes of war",
"/Lotus/Language/Oddities/TwoSisters_Line_56" :"The twin queens were wrought",
"/Lotus/Language/Oddities/TwoSisters_Line_6" :"Amidst the great war",
"/Lotus/Language/Oddities/TwoSisters_Line_7" :"All elders were gathered",
"/Lotus/Language/Oddities/TwoSisters_Line_8" :"For this life’s new dawn",
"/Lotus/Language/Oddities/TwoSisters_Line_9" :"Confused and bewildered",
