"/Lotus/Language/Sorties/AssassinationDesc1" :"Reconnaissance efforts at |PREVIOUS_LOCATION| have revealed that |BOSS_NAME| is directly overseeing an operation at |LOCATION|. Strike now while the opportunity exists.",
"/Lotus/Language/Sorties/CaptureDesc1" :"A double-agent for |BOSS_NAME| has been exposed and tracked down. Find him at |LOCATION| and recover the stolen data at any cost.",
"/Lotus/Language/Sorties/CounterIntelDesc1" :"A security breach has provided the opportunity to reroute the communication systems of a base operated by |BOSS_NAME|'s units. Reprogram the console at |LOCATION| before the window closes.",
"/Lotus/Language/Sorties/DefenseDesc1" :"A stranded Tenno informant has been discovered at |LOCATION| by a squad of |BOSS_NAME|'s units. Suppress the enemy before he can be captured.",
"/Lotus/Language/Sorties/DefenseToAssassinationDesc1" :"Reconnaissance efforts at |PREVIOUS_LOCATION| have revealed that |BOSS_NAME| is directly overseeing an operation at |LOCATION|. Strike now while the opportunity exists.",
"/Lotus/Language/Sorties/DefenseToDefenseDesc1" :"A stranded Tenno informant has been discovered at |LOCATION| by a squad of |BOSS_NAME|'s units. Defend him from being captured while an extraction force is established.",
"/Lotus/Language/Sorties/DefenseToExcavateDesc1" :"Mobilization orders intercepted at |PREVIOUS_LOCATION| suggest a large Cryotic deposit has been located at |LOCATION|. Excavate the site before |BOSS_NAME|'s units overtake it.",
"/Lotus/Language/Sorties/DefenseToExterminationDesc1" :"Evidence obtained from |PREVIOUS_LOCATION| indicates an advanced group of |BOSS_NAME|'s units is deployed at |LOCATION|. Eliminate them before they are alerted.",
"/Lotus/Language/Sorties/DefenseToHiveDesc1" :"Alerted enemy units from |PREVIOUS_LOCATION| have activated a breeding grounds for |BOSS_NAME| larvae at |LOCATION|. Destroy the hives before an outbreak occurs.",
"/Lotus/Language/Sorties/DefenseToIntelDesc1" :"Transmitters found at |PREVIOUS_LOCATION| are in communication with a concealed data network at |LOCATION|. Extract information without raising |BOSS_NAME|'s attention.",
"/Lotus/Language/Sorties/DefenseToMobileDefenseDesc1" :"The disruption of |BOSS_NAME|'s units at |PREVIOUS_LOCATION| has allowed us to breach the data network at |LOCATION|. Our datamasses have been deployed to the site; locate them and override the terminals.",
"/Lotus/Language/Sorties/DefenseToRescueDesc1" :"Intel extracted from |PREVIOUS_LOCATION| has uncovered a |BOSS_NAME| prison base at |LOCATION|. Go there and return captive operatives to safety.",
