"/Lotus/Language/Sorties/TerritoryDesc1" :"Unencrypted |BOSS_NAME| transmissions have been detected at |LOCATION|. Intercept these signals while they are still in flight.",
"/Lotus/Language/Sorties/TerritoryToAssassinationDesc1" :"Reconnaissance efforts at |PREVIOUS_LOCATION| have revealed that |BOSS_NAME| is directly overseeing an operation at |LOCATION|. Strike now while the opportunity exists.",
"/Lotus/Language/Sorties/TerritoryToDefenseDesc1" :"Transmissions intercepted from |PREVIOUS_LOCATION| reveal that |BOSS_NAME|'s units have pinpointed a stranded Tenno informant at |LOCATION|. Suppress the enemy before he can be captured.",
"/Lotus/Language/Sorties/TerritoryToExcavateDesc1" :"Mobilization orders intercepted at |PREVIOUS_LOCATION| suggest a large Cryotic deposit has been located at |LOCATION|. Excavate the site before |BOSS_NAME|'s units overtake it.",
"/Lotus/Language/Sorties/TerritoryToExterminationDesc1" :"Transmissions intercepted from |PREVIOUS_LOCATION| indicate an advanced group of |BOSS_NAME|'s units is deployed at |LOCATION|. Eliminate them before they are alerted.",
"/Lotus/Language/Sorties/TerritoryToHiveDesc1" :"Alerted enemy units from |PREVIOUS_LOCATION| have activated a breeding grounds for |BOSS_NAME| larvae at |LOCATION|. Destroy the hives before an outbreak occurs.",
"/Lotus/Language/Sorties/TerritoryToIntelDesc1" :"Transmissions intercepted from |PREVIOUS_LOCATION| were originally intended for a concealed data network at |LOCATION|. Extract information without raising |BOSS_NAME|'s attention.",
"/Lotus/Language/Sorties/TerritoryToMobileDefenseDesc1" :"Transmissions deciphered from |PREVIOUS_LOCATION| have allowed us to breach |BOSS_NAME|'s data network at |LOCATION|. Datamasses have been deployed to the site; locate them and override the terminals.",
"/Lotus/Language/Sorties/TerritoryToRescueDesc1" :"Transmissions intercepted from |PREVIOUS_LOCATION| have uncovered a |BOSS_NAME| prison base at |LOCATION|. Go there and return captive operatives to safety.",
"/Lotus/Language/Sorties/TerritoryToRetrievalDesc1" :"Transmissions intercepted from |PREVIOUS_LOCATION| indicate a large-scale power cell component is being held by |BOSS_NAME| at |LOCATION|. Retrieve it for our own purposes.",
"/Lotus/Language/Sorties/TerritoryToSabotageDesc1" :"Transmissions intercepted from |PREVIOUS_LOCATION| have revealed a secret base controlled by |BOSS_NAME|'s units at |LOCATION|. Destroy all essential machinery while the enemy is taken off guard.",
"/Lotus/Language/Sorties/TerritoryToSurvivalDesc1" :"Transmissions intercepted from |PREVIOUS_LOCATION| have unveiled an artifact guarded by |BOSS_NAME|'s units at |LOCATION|. Engage enemy units there while our operatives retrieve it.",
"/Lotus/Language/Sorties/TerritoryToTerritoryDesc1" :"Unencrypted |BOSS_NAME| transmissions have been detected at |LOCATION|. Intercept these signals while they are still in flight.",
"/Lotus/Language/Sorties/WorldStateLockedHint" :"Complete 'The War Within' quest and equip a Rank |SUIT_RANK| Warframe.",
"/Lotus/Language/Sorties/WorldStateLockedTitle" :"Sortie Not Available",
"/Lotus/Language/Sorties/WorldStateNoSortiesHint" :"No sorties currently available.",
"/Lotus/Language/SpaceGuns/ArchCannonDesc" :"When fully charged, this flak-cannon delivers a devastating shot. Perfect for taking down fast-moving interceptors.",
"/Lotus/Language/SpaceGuns/ArchCannonName" :"CORVAS",
"/Lotus/Language/SpaceGuns/ArchHeavyPistolsDesc" :"Delivering twin streams of highly accurate, rapid-fire ordnance, the Decurion are specifically designed for combat in the vacuum of space.",
"/Lotus/Language/SpaceGuns/ArchHeavyPistolsName" :"DUAL DECURION",
"/Lotus/Language/SpaceGuns/ArchMachinegunDesc" :"A long range rifle capable of firing in space, the Imperator's versatility makes it an ideal weapon for space combat.",
"/Lotus/Language/SpaceGuns/ArchMachinegunName" :"IMPERATOR",
"/Lotus/Language/SpaceGuns/ArchRailgunDesc" :"When fully charged, the magnetized barrel of the Velocitus accelerates a metal slug to tremendous speeds, piercing hulls and obliterating armor.",
"/Lotus/Language/SpaceGuns/ArchRailgunName" :"VELOCITUS",
"/Lotus/Language/SpaceGuns/ArchRocketCrossbowDesc" :"An Archwing energy weapon that sends waves of deadly plasma crashing into enemies.",
"/Lotus/Language/SpaceGuns/ArchRocketCrossbowName" :"FLUCTUS",
"/Lotus/Language/SpaceGuns/ImperatorVandalDesc" :"The Imperator Vandal has been customized by the Tenno with a blue-green metallic finish and Lotus branding on the barrel.",
"/Lotus/Language/SpaceGuns/ImperatorVandalName" :"IMPERATOR VANDAL",
"/Lotus/Language/SpaceMelee/ArchAxeDesc" :"This laser bladed battle-axe easily hacks through a ship's defenses and the forces protecting it.",
"/Lotus/Language/SpaceMelee/ArchAxeName" :"ONORIX",
"/Lotus/Language/SpaceMelee/ArchHammerDesc" :"ARCHWING\" :Using Archwing’s jets for thrust, this massive hammer crushes anything in its path.",
"/Lotus/Language/SpaceMelee/ArchHammerName" :"RATHBONE",
"/Lotus/Language/SpaceMelee/ArchSwordDesc" :"Weightless space turns this impossibly massive sword into an agile instrument of destruction.",
"/Lotus/Language/SpaceMelee/ArchSwordName" :"VERITUX",
"/Lotus/Language/SpaceMelee/ArchSwordShieldDesc" :"Part sword, part shield, the Centaur excels at charging headlong into enemy fire.",
"/Lotus/Language/SpaceMelee/ArchSwordShieldName" :"CENTAUR",
